import {ADD_AGENCY,ADD_AGENCY_FAIL } from './type'; 

export const Agency = ({
    phone,
    agencyName,
    headOfficeLocation
}) => async dispatch => {
    const config = {
        headers: {
            'Content-Type': 'application/json'
        }
    };

    const body = JSON.stringify({ phone, agencyName, headOfficeLocation });
    try {
        const res = await axios.post('/admins/admin/agency', body, config);
        dispatch({
            type: ADD_AGENCY,
            payload: res.data
        });

        dispatch(setAlert('Agency has added Successfully', 'success'));
    } catch (err) {
        dispatch(setAlert('Agency does already exists', 'danger'));
        console.log(err);
        dispatch({ type: ADD_AGENCY_FAIL });
    }
};
